import {
  Component,
  ViewChild,
  AfterViewInit
} from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatTableDataSource, MatTableModule } from '@angular/material/table';
import { MatPaginator, MatPaginatorModule } from '@angular/material/paginator';
import { MatSort, MatSortModule } from '@angular/material/sort';
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { MatDialog, MatDialogModule } from '@angular/material/dialog';
import { MatSnackBar, MatSnackBarModule } from '@angular/material/snack-bar';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

import { UserFormComponent, UserFormData } from '../user-form/user-form.component';
import { MatTooltip } from '@angular/material/tooltip';

interface User extends UserFormData {
  id: number;
  createdAt: string;
}

const STORAGE_KEY = 'hormonal-users';

@Component({
  selector: 'app-user-list',
  standalone: true,
  imports: [
    CommonModule,
    MatTableModule,
    MatPaginatorModule,
    MatSortModule,
    MatIconModule,
    MatButtonModule,
    MatDialogModule,
    UserFormComponent,
    MatSnackBarModule,
    MatTooltip
  ],
  templateUrl: './user-list.component.html',
  styleUrls: ['./user-list.component.css']
})
export class UserListComponent implements AfterViewInit {
  displayedColumns: string[] = ['name', 'email', 'role', 'status', 'createdAt', 'actions'];
  users: User[] = [];
  dataSource = new MatTableDataSource<User>();

  @ViewChild(MatPaginator) paginator!: MatPaginator;
  @ViewChild(MatSort) sort!: MatSort;

  constructor(private dialog: MatDialog, private snackBar: MatSnackBar) {
    const savedUsers = localStorage.getItem(STORAGE_KEY);
    if (savedUsers) {
      try {
        this.users = JSON.parse(savedUsers);
      } catch (e) {
        console.error('Error al parsear usuarios guardados', e);
        this.users = [];
      }
    } else {
      this.users = [
        {
          id: 1,
          name: 'Ana Pérez',
          email: 'ana@example.com',
          role: 'Paciente',
          status: 'Activo',
          createdAt: '2025-05-01'
        },
        {
          id: 2,
          name: 'Dr. Carlos Ríos',
          email: 'carlos@example.com',
          role: 'Doctor',
          status: 'Inactivo',
          createdAt: '2025-04-10'
        },
        {
          id: 3,
          name: 'Admin Root',
          email: 'admin@example.com',
          role: 'Admin',
          status: 'Activo',
          createdAt: '2025-01-20'
        }
      ];
      this.saveToStorage();
    }

    this.dataSource.data = this.users;
    this.dataSource.sortingDataAccessor = (item, property) => {
      return property === 'createdAt' ? new Date(item.createdAt) : (item as any)[property];
    };
  }

  ngAfterViewInit(): void {
    this.dataSource.paginator = this.paginator;
    this.dataSource.sort = this.sort;
  }

  applyFilter(event: Event): void {
    const filterValue = (event.target as HTMLInputElement).value.trim().toLowerCase();
    this.dataSource.filter = filterValue;
  }

  toggleUserStatus(user: User): void {
    user.status = user.status === 'Activo' ? 'Inactivo' : 'Activo';
    this.refreshTable();
    this.saveToStorage();
    this.showSnackbar(`Usuario ${user.status === 'Activo' ? 'activado' : 'inactivado'}`);
  }

  openUserForm(user?: User): void {
    const dialogRef = this.dialog.open(UserFormComponent, {
      width: '400px',
      data: user || null
    });

    dialogRef.componentInstance.userData = user || null;

    dialogRef.componentInstance.formSubmit.subscribe((formValue: UserFormData) => {
      if (user) {
        const index = this.users.findIndex(u => u.id === user.id);
        if (index > -1) {
          this.users[index] = { ...user, ...formValue };
          this.showSnackbar('Usuario actualizado correctamente');
        }
      } else {
        const newUser: User = {
          id: this.generateId(),
          ...formValue,
          createdAt: new Date().toISOString().slice(0, 10)
        };
        this.users.push(newUser);
        this.showSnackbar('Usuario creado con éxito');
      }

      this.refreshTable();
      this.saveToStorage();
      dialogRef.close();
    });

    dialogRef.componentInstance.cancel.subscribe(() => {
      dialogRef.close();
    });
  }

  onDelete(user: User): void {
    this.users = this.users.filter(u => u.id !== user.id);
    this.refreshTable();
    this.saveToStorage();
    this.showSnackbar('Usuario eliminado');
  }

  private refreshTable(): void {
    this.dataSource.data = [...this.users];
  }

  private saveToStorage(): void {
    localStorage.setItem(STORAGE_KEY, JSON.stringify(this.users));
  }

  private generateId(): number {
    return Math.max(0, ...this.users.map(u => u.id)) + 1;
  }

  private showSnackbar(message: string): void {
    this.snackBar.open(message, 'Cerrar', {
      duration: 3000,
      panelClass: ['snackbar-success']
    });
  }

  exportToCSV(): void {
    const headers = ['Nombre', 'Correo', 'Rol', 'Estado', 'Registro'];
    const rows = this.users.map(user => [
      `"${user.name}"`,
      `"${user.email}"`,
      `"${user.role}"`,
      `"${user.status}"`,
      `"${user.createdAt}"`
    ]);

    const csvContent =
      headers.join(',') + '\n' +
      rows.map(row => row.join(',')).join('\n');

    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'usuarios.csv';
    a.click();
    window.URL.revokeObjectURL(url);

    this.showSnackbar('Exportación a CSV completada');
  }

  exportToPDF(): void {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();

    const now = new Date();
    const fechaStr = now.toLocaleDateString();

    const logoBase64 = 'data:image/png;base64,'; // tu logo completo aquí
    doc.addImage(logoBase64, 'PNG', pageWidth - 36, 10, 22, 22);

    doc.setFontSize(18);
    doc.setTextColor(40);
    doc.text('Lista de Usuarios', 14, 20);

    doc.setFontSize(10);
    doc.setTextColor(80);
    doc.text(`Exportado: ${fechaStr}`, 14, 27);

    autoTable(doc, {
      startY: 35,
      head: [['Nombre', 'Correo', 'Rol', 'Estado', 'Registro']],
      body: this.users.map(user => [
        user.name,
        user.email,
        user.role,
        user.status,
        user.createdAt
      ]),
      styles: { fontSize: 10 },
      headStyles: { fillColor: [85, 26, 139], textColor: 255 },
      didDrawPage: () => {
        const pageInfo = doc.getCurrentPageInfo();
        const totalPages = doc.getNumberOfPages();
        const text = `Página ${pageInfo.pageNumber} de ${totalPages}`;
        doc.setFontSize(9);
        doc.text(text, pageWidth / 2, pageHeight - 10, { align: 'center' });
      }
    });

    doc.addPage();
    doc.setFontSize(16);
    doc.setTextColor(40);
    doc.text('Resumen Estadístico de Usuarios', 14, 20);

    const total = this.users.length;
    const activos = this.users.filter(u => u.status === 'Activo').length;
    const inactivos = this.users.filter(u => u.status === 'Inactivo').length;

    const porRol = this.users.reduce((acc, u) => {
      acc[u.role] = (acc[u.role] || 0) + 1;
      return acc;
    }, {} as Record<string, number>);

    let y = 35;
    doc.setFontSize(12);
    doc.text(`Total de usuarios: ${total}`, 14, y); y += 10;
    doc.text(`Usuarios activos: ${activos}`, 14, y); y += 10;
    doc.text(`Usuarios inactivos: ${inactivos}`, 14, y); y += 15;

    doc.setFontSize(12);
    doc.setTextColor(85, 26, 139);
    doc.text('Totales por Rol:', 14, y); y += 10;

    doc.setTextColor(0);
    Object.entries(porRol).forEach(([rol, cantidad]) => {
      doc.text(`• ${rol}: ${cantidad}`, 20, y);
      y += 8;
    });

    doc.setDrawColor(150);
    doc.line(14, y, pageWidth - 14, y);

    doc.save('usuarios.pdf');
    this.showSnackbar('Exportación a PDF completada');
  }
}
